import requests
import base64
import time
from concurrent.futures import ThreadPoolExecutor, as_completed

# API endpoint
url = "httpsttt"  # replace with your actual endpoint

# Headers
headers = {
    "X-Source-Environment": "staging",
    "X-Request-ID": "yyyyy",
    "Content-Type": "application/json"
}

# Read image and convert to base64
# with open("image.png", "rb") as img_file:
#     image_b64 = base64.b64encode(img_file.read()).decode("utf-8")

# Request body
payload = {
    "images": [""],
    "style_id": 2,          # replace with actual style_id
    "color_scheme_id": 2    # replace with actual color_scheme_id
}

# Send POST request
# start= time.time()
# for x in range(4):
#     response = requests.post(url, headers=headers, json=payload)
#     print("Status Code:", response.status_code)
#     print("Response Body:", response.text)
#     print("time ", time.time()-start)



def send_request(i):
    """Worker function to send POST request."""
    resp = requests.post(url, headers=headers, json=payload)
    return i, resp.status_code, resp.text

start = time.time()

# send 4 requests in parallel
futures = []
with ThreadPoolExecutor(max_workers=4) as executor:
    for i in range(20):
        futures.append(executor.submit(send_request, i))

# Collect and print results after all finish
for future in as_completed(futures):
    i, status, body = future.result()
    print(f"[Request {i}] Status: {status}")
    print(f"[Request {i}] Body: {body}\n")

print("Total time:", time.time() - start)
